import React from "react";
import DefaultLayout from "../components/DefaultLayout";
import templateimg from '../resources/templates/template1.png'

function Home(){
  const templates=[
    {
      title:'Simple Resume',
      image:templateimg,
    }
  ]
    return(
      <DefaultLayout>
       <div className="row">
         {templates.map((template)=>{
          return(
          <div className="col-md-6 template">
              <img src={template.image} height='400' width='300' alt="template"></img>
          </div>
         )}
         )}
       </div>
      </DefaultLayout>
    )
}
export default Home
